const CategoryList = (props) =>{

    console.log("Category List", props);

    return (
        <div>
        props.categories.map((item)=>{
           <div   key={item.id}>
            <span>test</span>
           
            <h2>{item.name}</h2>
            
          </div>
           
        }
        )
        </div>
    )
        
    }

export default CategoryList;
